My_entry.pen.prototype.init_plot2d = function(){
  var self = this;
  var options = self.options;
  options["plot-canvas-width"] = self.entry.def.limit(options["plot-canvas-width"], 16, 2560, 512);
  options["plot-canvas-height"] = self.entry.def.limit(options["plot-canvas-height"], 16, 2560, 256);
  self.plot2d = new self.constructors.plot2d("div-plot2d", options["plot-canvas-width"], options["plot-canvas-height"]);
  return self;
};
My_entry.pen.prototype.update_plot2d = function(isFinal){  // fluid-Ver.1.23.0
  var self = this;
  var _svg = null;  // fluid-Ver.1.23.0
  /* fluid-Ver.1.22.0 -> */
  var $ = self.entry.$;
  var options = self.options;
  var uvp = self.uvp;
  var temp = self.plot2d.objs.temp;  // fluid-Ver.1.23.0
  if(uvp){
    var toSVG = (isFinal === "SVG");  // fluid-Ver.1.23.0
    self.entry.def.mix_over(self.constructors.draw, self.constructors["draw_"+((toSVG)? "svg": "canvas")]);
    /* fluid-Ver.1.24.0 -> */
    if(!(isFinal)){
      self.update_arr2d_vec();
    }
    /* -> fluid-Ver.1.24.0 */
    var sw_plot = $._id("select-plot").value;
    var arr_plot = uvp["_arr_"+sw_plot];
    /* fluid-Ver.1.53.2 -> */
    var label_x = "t";
    var label_y = sw_plot;
    var arr_x = uvp._arr_t;
    var arr_y = arr_plot;
    if(sw_plot === "uj" || sw_plot === "vj" || sw_plot === "pj"){
      label_x = "x";
      arr_x = [];
      arr_y = [];
      for(var i=0; i<uvp.Ni; ++i){
        arr_x.push([uvp.dx*(i+0.5)]);
        arr_y.push([uvp[sw_plot[0]][i][uvp._j_plot]]);
      }
    }
    else if(sw_plot === "ui" || sw_plot === "vi" || sw_plot === "pi"){
      label_x = "y";
      arr_x = [];
      arr_y = [];
      for(var j=0; j<uvp.Nj; ++j){
        arr_x.push([uvp.dy*(j+0.5)]);
        arr_y.push([uvp[sw_plot[0]][uvp._i_plot][j]]);
      }
    }
    var arr2d_vec = {x: arr_x, y: arr_y, len_n: arr_x.length, len_j: 1, gxmin: Math.min.apply(Math, arr_x), gxmax: Math.max.apply(Math, arr_x), gymin: Math.min.apply(Math, arr_y), gymax: Math.max.apply(Math, arr_y)};
    /* -> fluid-Ver.1.53.2 */
    var options_plot = {
      decDigit: 1,
      expDigit: -1,
      "marker-size": 0,
      "marker-line-width": 0,
      "plot-line-width": 2,
      "grid-line-width": 0.5,
      "grid-line-color": "gray",
      "bg-color": "black",
      globalCompositeOperationAll: "source-over",  // fluid-Ver.1.24.0
      "canvas-globalCompositeOperationLayer": "source-over",  // fluid-Ver.1.24.0
      "log-x": false,
      "log-y": false,
      "imag-x": false,
      "imag-y": false,
      legend: false,
      "axis-x": true,
      "axis-y": true,
      "axis-z": true,
      "font-size": 12,
      "grid-x-Ni": 0,
      "grid-y-Nj": 0,
      "kx-adjust": 2.5,
      "legend-kx": 0.25,
      "legend-ky": 0.1,
      "marker-colors": "rainbow",  // fluid-Ver.1.51.1
      "input-z": "ORIGIN{2.5,gray,17}XLABEL{"+label_x+"}YLABEL{"+label_y+"}"  // fluid-Ver.1.51.1  // fluid-Ver.1.53.2
    };
  /* -> fluid-Ver.1.22.0 */
    for(var prop in options_plot){
      var option = options[prop];
      if(typeof option !== "undefined"){
        options_plot[prop] = option;
      }
    }
    options_plot.arr_x = [];
    options_plot.arr_y = [];
    /* fluid-Ver.1.23.0 -> */
    if(toSVG){
      _svg = "";
      _svg += temp.draw.header(options["plot-canvas-width"], options["plot-canvas-height"]);
      _svg += temp.draw.comment(My_entry.VERSION);
      _svg += self.plot2d.run(arr2d_vec, options_plot, toSVG, true);  // fluid-Ver.1.55.2
      _svg += temp.draw.footer();
    }
    else{
      _svg = self.plot2d.run(arr2d_vec, options_plot, toSVG, isFinal);  // fluid-Ver.1.55.2
    }
    temp.detach();
    /* -> fluid-Ver.1.23.0 */
  }
  return _svg;
};
